    //         <div className="Shopcart">
    //             <h2>Shop Cart</h2>

    //             <p>Koszyk jest pusty.</p>
    //         </div>);
    // }

    return (
        <div className="Shopcart">
            <h2>Shop Cart</h2>

            <ul className="cart-list">
                {props.products.map((product) => {
                    <li key={product.id}>
                        <span>{product.title}</span>
                        <span>{product.price} zł</span>
                        <button >Usuń</button>
                    </li>
})}
            </ul>
        </div>
    );
}



export default ShopCart
